import React from 'react'

const HeaderOfPage = () => {
    return (
        <div className="header">
            <div className="logo">
                <div className="logoText">Yalantis shop</div>
            </div>
            <div className="orderedProduct">
                <div></div>
            </div>
        </div>
    )
}

export default HeaderOfPage;
